        'TSX ', 'INS ', 'PULA', 'PULB', 'DES ', 'TXS ', 'PHSA', 'PSHB', 'PULX', 'RTS ', 'ABX ', 'RTI ', 'PSHX', 'MUL ', 'WAI ', 'SWI ',
